def Fibonacci(N):    '''    Fonction qui prend en entrée un entier N > 2.    Elle renvoie les N premiers termes de la séquence de Fibonacci.    Par ex: Fibonacci(5) renverra [0, 1, 1, 2, 3].    '''    Resultat = [0, 1]    for i in range(2, N):        Resultat.append(Resultat[i - 1] + Resultat[i - 2])    return Resultat